import { InputText, Password } from "primereact";
import React from "react";
import { ButtonsPrimary } from "../../../shared/components/Buttons/ButtonsPrimary";
import { LoginComponent } from "./FormLogin.components";
import "./stylesForm.css";
export const FormLoginHtml = () => {
  const { errors, handleSubmit, onSubmit, register } = LoginComponent();
  return (
    <React.Fragment>
      <div className="items">
        <h4>Login</h4>
      </div>
      <div className="items">
        <form onSubmit={() => handleSubmit(onSubmit)}>
          <label htmlFor="username">Username</label>
          <div className="form-group">
            <span className="p-input-icon-left">
              <i className="pi pi-user" />
              <InputText placeholder="username" id="username" />
            </span>
          </div>
          <label htmlFor="password">password</label>
          <div className="form-group">
            <Password id="password" toggleMask placeholder="********" />
          </div>
          <div className="form-group">
            <ButtonsPrimary
              type="submit"
              label="Sign in"
              styles={{ width: "100%" }}
            />
          </div>
        </form>
      </div>
    </React.Fragment>
  );
};
